function ContDowLeiloes(){
    if(TotalLeiloesOnline>0){
        clearTimeout(Requisitacoes_ContDow);
        SeparaLeiloes=ListaLeiloesOnline.split("_");
        for(i=1;i<=TotalLeiloesOnline;i++){
            CodigoLeilao=SeparaLeiloes[i];
            VarBox=$("#LeilaoOnline_Info_"+CodigoLeilao).val();
            if(VarBox!=""){
                VarBoxSepara=VarBox.split("__");
                TimeAtual=mktime();
                TimeProduto=Trim(VarBoxSepara[0]);
                Fixador=Trim(VarBoxSepara[1]);    
                Status=Trim(VarBoxSepara[2]);
                DataFinalizacao=Trim(VarBoxSepara[3]);Diferenca=TimeProduto-TimeAtual-GmtSegundo-FalhaTempo-1;
                console.debug(Diferenca);
                if(Status=="2"){
                    CarregaTimeLeilao(CodigoLeilao,Fixador,Diferenca,DataFinalizacao);
                }else if(Status=="3"){
                    CarregaTimeLeilao(CodigoLeilao,Fixador,Fixador,DataFinalizacao);
                }else if(Status=="F"){
                    DisparaFinalizadoLeilao(CodigoLeilao,Fixador,Diferenca);
                }
            }
        }
        var Requisitacoes_ContDow=window.setTimeout("ContDowLeiloes()",1000);
    }
}
function DisparaFinalizadoLeilao(CodigoLeilao,Fixador,Diferenca){
    if(Diferenca<=0){
        $("#L_StatusTxt_"+CodigoLeilao).html("ARREMATADO!");
        $("#BoxLeilao_"+CodigoLeilao).attr("class","BoxLeilao BoxLeilao_Finalizou");
        $("#BoxLeilao2_"+CodigoLeilao).attr("class","BoxLeilao2 BoxLeilao2_Finalizou");
        $("#L_Botao_Box_"+CodigoLeilao).hide();
        $("#L_Botao_BoxF_"+CodigoLeilao).show();
        $(".L_BoxLeilaoIntF_"+CodigoLeilao).show();
        $(".L_BoxLeilaoInt2_"+CodigoLeilao).hide();
        RetroClock(CodigoLeilao,00);
    }else{
        RequisitacaoLeiloesEsp(CodigoLeilao);
        $("#L_StatusTxt_"+CodigoLeilao).html("Em Andamento!");
        $("#L_StatusTxt2A_"+CodigoLeilao).hide();
        $("#L_StatusTxt2B_"+CodigoLeilao).show();
        $("#L_Botao_Box_"+CodigoLeilao).show();
        $("#L_Botao_BoxF_"+CodigoLeilao).hide();
        $(".L_BoxLeilaoIntF_"+CodigoLeilao).hide();
        $(".L_BoxLeilaoInt2_"+CodigoLeilao).show();
        RetroClock(CodigoLeilao,Fixador);
    }
}

function CarregaTimeLeilao(CodigoLeilao,Fixador,Diferenca,DataFinalizacao)
{
    //console.debug(Diferenca)
    DifBase=Diferenca-4;
    if(DifBase<=Fixador){
        $("#L_StatusTxt_"+CodigoLeilao).html("Em Andamento!");
        $("#L_StatusTxt2A_"+CodigoLeilao).hide();
        $("#L_StatusTxt2B_"+CodigoLeilao).show();
    }else{
        $("#L_StatusTxt_"+CodigoLeilao).html("Incio dia "+DataFinalizacao);
        $("#L_StatusTxt2A_"+CodigoLeilao).show();
        $("#L_StatusTxt2B_"+CodigoLeilao).hide();
    }
    $("#L_Botao_Box_"+CodigoLeilao).show();
    $("#L_Botao_BoxF_"+CodigoLeilao).hide();
    $(".L_BoxLeilaoIntF_"+CodigoLeilao).hide();
    $(".L_BoxLeilaoInt2_"+CodigoLeilao).show();

    if(Diferenca<1){
        RetroClock(CodigoLeilao,1);
    }else{
        
        if(Diferenca<Fixador){
            RetroClock(CodigoLeilao,Diferenca);
            if(Diferenca<=5){
                $("#BoxLeilao_"+CodigoLeilao).attr("class","BoxLeilao BoxLeilao_Finalizando1");
                $("#BoxLeilao2_"+CodigoLeilao).attr("class","BoxLeilao2 BoxLeilao2_Finalizando1");
            }else if(Diferenca<=10){
                $("#BoxLeilao_"+CodigoLeilao).attr("class","BoxLeilao BoxLeilao_Finalizando2");
                $("#BoxLeilao2_"+CodigoLeilao).attr("class","BoxLeilao2 BoxLeilao2_Finalizando2");
            }else{
                $("#BoxLeilao_"+CodigoLeilao).attr("class","BoxLeilao BoxLeilao_Iniciou");
                $("#BoxLeilao2_"+CodigoLeilao).attr("class","BoxLeilao2 BoxLeilao2_Iniciou");
            }
        }else{
            RetroClock(CodigoLeilao,Fixador);
            if(DifBase<=Fixador){
                $("#BoxLeilao_"+CodigoLeilao).attr("class","BoxLeilao BoxLeilao_Iniciou");
                $("#BoxLeilao2_"+CodigoLeilao).attr("class","BoxLeilao2 BoxLeilao2_Iniciou");
            }else{
                $("#BoxLeilao_"+CodigoLeilao).attr("class","BoxLeilao");
                $("#BoxLeilao2_"+CodigoLeilao).attr("class","BoxLeilao2");
            }
        }
    }
}
