var MicroTime=0;
function MicroTimeServidor()
{
    var req=$.ajax({
        type:"GET",
        url:"./Ret_MicroTimeServidor.php",
        cache:false,
        timeout:10000,
        data:"Rand="+encodeURI(Math.random()),
        success:function(msg){
            DataTmp=new Date();
            GtmCliente=DataTmp.getTimezoneOffset()/60;
            GmtServidor=3;
            GmtDiferenca=GmtServidor-GtmCliente;
            GmtSegundo=GmtDiferenca*60*60;
            MicroTime=msg-GmtSegundo;
            RelogioTopo();
            var req=null
            delete req
        },
        beforeSend:function(){
            var req=null
            delete req
        }
    });
    var req=null
    delete req
}
function RelogioTopo(){
    clearTimeout(Requisitacoes_RelogioTopo);
    if(MicroTime>0){
        MicroTime=parseInt(MicroTime)+1;
        Data1=date('d . F . Y',MicroTime);
        Data1=Data1.replace(".","de");
        Data1=Data1.replace(".","de");
        Data2=date('H:i:s',MicroTime);
        $("#time").html(date('l',MicroTime)+", "+Data1+' - '+Data2);
        var Requisitacoes_RelogioTopo=window.setTimeout("RelogioTopo()",1000);
    }
}
